    playbackData.comments = {"eb183eab-9292-4c5b-9b2a-b7abd5297252":[{"id":"f222ffb6-e11f-46a1-9912-3c0617ac6260","displayCommentEventId":"eb183eab-9292-4c5b-9b2a-b7abd5297252","displayCommentEventSequenceNumber":0,"developerGroupId":"3791fae1-ca8d-4309-851b-e4621fecfbc8","timestamp":1729473830255,"commentText":"A playback covering logical values and how they interact with <span style=\"font-family: Courier;\">NA</span> values.&nbsp; We cover combinations using <span style=\"font-family: Courier;\">!, &amp;</span>, and<span style=\"font-family: Courier;\"> |</span>, as well as discussing <span style=\"font-family: Courier;\">is.na() </span>and <span style=\"font-family: Courier;\">if_else()</span>.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"adfe8b0c-22dd-42d2-988e-5e864d345b10":[{"id":"be830043-b8ee-45e9-a1f2-67cae2bb8309","displayCommentEventId":"adfe8b0c-22dd-42d2-988e-5e864d345b10","displayCommentEventSequenceNumber":243,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729475853259,"commentText":"For this example, we imagine having an inventory list of products., read in and saved to the variable <span style=\"font-family: Courier;\">prods</span>.&nbsp; &nbsp;This data contains the product name, how much of that product we have on the shelves when fully stocked, our current stock, and some marketing indicators, such as whether or not the product is in stock, in season, or currently on sale.<div><br></div><div>(Because this example is small, I didn't include something like how much the product is selling for or sales percentages, but real life data would probably have that information also!)</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729475738516-oreo1.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"3a9b84a6-4d2c-4226-b476-cb01d09bae13":[{"id":"4512b52e-4168-4acc-8997-0a7f682fc0e0","displayCommentEventId":"3a9b84a6-4d2c-4226-b476-cb01d09bae13","displayCommentEventSequenceNumber":319,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729476181862,"commentText":"One action we may wish to take on this data is to build an indicator of when we may wish to buy more of a given product.&nbsp; While one indicator that we need to buy more of a product is that it is not in stock (here represented by <span style=\"font-family: Courier;\">!in_stock)</span>, we may also wish to buy more of our seasonal products if we expect them to sell out quickly.&nbsp; Here, we create a new column for the data frame called<span style=\"font-family: Courier;\"> buy_more</span> that is <span style=\"font-family: Courier;\">TRUE</span>&nbsp;if either of these conditions hold (either the item is seasonal or it is not in stock) and <span style=\"font-family: Courier;\">FALSE</span>&nbsp;otherwise.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["in_stock = TRUE","in_stock = FALSE","in_stock == TRUE","in_stock == FALSE"],"correctAnswer":"in_stock == FALSE","question":"Which of the following is equivalent to the <span style=\"font-family: Courier;\">!in_stock</span> portion of the code here?","explanation":"Remember, we check for equality with TWO equal signs (double equal).&nbsp; The ! roughly means not, so <span style=\"font-family: Courier;\">!in_stock</span> translates to \"is not true\", i.e., is false."}},{"id":"601f697e-5bd9-4de3-a2d3-c72fe2005e33","displayCommentEventId":"3a9b84a6-4d2c-4226-b476-cb01d09bae13","displayCommentEventSequenceNumber":319,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729478680882,"commentText":"Here is a view of the<span style=\"font-family: Courier;\"> prods</span> data with the newly added <span style=\"font-family: Courier;\">buy_more</span> column.","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":["media/images/1729478676893-oreo2.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"a47a07f8-ba43-4235-8703-a646abcfda95":[{"id":"1ea817c7-123f-4940-b660-cce2688a03dc","displayCommentEventId":"a47a07f8-ba43-4235-8703-a646abcfda95","displayCommentEventSequenceNumber":361,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729479106682,"commentText":"While the <span style=\"font-family: Courier;\">!</span> here means \"not\", two different behaviors seem theoretically possible when we <span style=\"font-family: Courier;\">filter</span> to things that are <span style=\"font-style: italic;\">not</span>&nbsp;in stock; does that mean values for which <span style=\"font-family: Courier;\">in_stock</span> is not <span style=\"font-family: Courier;\">TRUE</span>, (which would include NA values) or <span style=\"font-family: Courier;\">in_stock</span> values that are <span style=\"font-family: Courier;\">FALSE</span>?&nbsp; The result of this line of code is shown below.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729479193547-oreoNotInStock.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"8d119614-e506-48b5-be2c-35145984a2e0":[{"id":"ecbba548-3e53-4fb4-943a-17db2fa2b0ca","displayCommentEventId":"8d119614-e506-48b5-be2c-35145984a2e0","displayCommentEventSequenceNumber":360,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729479178017,"commentText":"One thing to notice from the previous view of&nbsp;<span style=\"font-family: Courier;\">prods</span>&nbsp;(inserted here also with columns highlighted) is that the&nbsp;<span style=\"font-family: Courier;\">in_stock</span>&nbsp;column actually contains three values; our logical values&nbsp;<span style=\"font-family: Courier;\">TRUE</span>&nbsp;and&nbsp;<span style=\"font-family: Courier;\">FALSE</span>, and&nbsp;<span style=\"font-family: Courier;\">NA</span>&nbsp;values.&nbsp;<div><br></div><div>While&nbsp;<span style=\"font-family: Courier;\">NA</span>&nbsp;values often correspond to missing data (indeed, this is a good way to think about them), they sometimes indicate something else, like that there is no meaningful value to attribute to this observation OR the variable does not apply to this value.&nbsp; Here, we are using the<span style=\"font-family: Courier;\">&nbsp;NA</span>&nbsp;value to indicate that the item is no longer sold by the company.&nbsp; It is neither in stock nor necessarily out of stock - it is an archived item.</div><div><br></div><div><span style=\"font-family: Courier;\">NA</span> values often behave non-intuitively.&nbsp; Here, we show that a filter to show only <span style=\"font-family: Courier;\">in_stock </span>values does NOT include the rows with<span style=\"font-family: Courier;\"> NA</span> values; it only shows the values that are <span style=\"font-family: Courier;\">TRUE.</span></div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729479318011-oreo25.png","media/images/1729479328009-oreoInStock.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"8a488373-91bc-4cf7-bc9b-3096ce666d0f":[{"id":"1588035e-bcd1-46ef-812f-2babf88f365e","displayCommentEventId":"8a488373-91bc-4cf7-bc9b-3096ce666d0f","displayCommentEventSequenceNumber":422,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729479577842,"commentText":"Another business use case we might consider is one in which items are on sale.&nbsp; If a theoretical user is to place an item in their cart and we need a computer to know when to apply the discount, we need to check both that the item CAN be placed in the cart and that the item is one of those that is on sale.&nbsp; For this, we combine our two logical vectors via our <span style=\"font-family: Courier;\">&amp;</span> operator, creating a new column called <span style=\"font-family: Courier;\">apply_sale</span> that keeps track of which items can actually realize a sale.<div><br></div><div>The data frame with the new column added is shown below.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729479571768-oreo3.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"91667013-d0d4-4936-9ba8-a047036cb8c8":[{"id":"8e8810ed-2fdf-43d6-86eb-a36b989a54bc","displayCommentEventId":"91667013-d0d4-4936-9ba8-a047036cb8c8","displayCommentEventSequenceNumber":436,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729480169434,"commentText":"The image below shows the results of the two newly added columns: <span style=\"font-family: Courier;\">buy_more</span> and <span style=\"font-family: Courier;\">apply_sale</span>.&nbsp; Pay particular attention to the rows with the <span style=\"font-family: Courier;\">NA</span> values.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729479733684-oreo35.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"555e2638-03ff-43fb-96b1-0bfee098880e":[{"id":"f8c3be37-b377-40b5-bc3b-e138ddd93aad","displayCommentEventId":"555e2638-03ff-43fb-96b1-0bfee098880e","displayCommentEventSequenceNumber":560,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729509747569,"commentText":"In a discrete structures class, you might study something about <span style=\"font-style: italic;\">truth tables</span>, which the video here details.&nbsp; The truth tables shown here have highlighted what happens when we know only the second logical value (i.e. the second column).&nbsp; When the answer in the third column, the one with the logical operator, is the same no matter what, we highlight that in blue.&nbsp; When the outcome varies, we highlight that in orange.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729519604978-TruthTable1.bmp","media/images/1729519608789-TruthTable2.bmp"],"videoURLs":["media/videos/1729534156740-TruthTables.mp4"],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image","video"],"questionCommentData":null},{"id":"bbaf32e2-9f1c-4e14-8e30-ffaa2dedf70a","displayCommentEventId":"555e2638-03ff-43fb-96b1-0bfee098880e","displayCommentEventSequenceNumber":560,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729528901338,"commentText":"Notice that when we combine two logical values with <span style=\"font-family: Courier;\">|</span> and we know that one of the logical values is <span style=\"font-family: Courier;\">TRUE</span>, the result via OR will be <span style=\"font-family: Courier;\">TRUE</span>.&nbsp; Remember, it doesn't matter if we have our passport if we know we have our state ID - we will be able to fly.<div><br></div><div>Similarly, when we combine&nbsp; two logical values with <span style=\"font-family: Courier;\">&amp;</span> and we know that one of the logical values is <span style=\"font-family: Courier;\">FALSE,</span> the result via AND will be <span style=\"font-family: Courier;\">FALSE</span>.&nbsp; Remember, it doesn't matter if we have our money or not if the bus doesn't show up - we won't be on the bus.</div><div><br></div><div>This gives us a good idea of what happens when <span style=\"font-family: Courier;\">&amp;</span> and<span style=\"font-family: Courier;\"> |</span> encounter NA values.&nbsp; If we join <span style=\"font-family: Courier;\">NA</span> values with logicals, we can sometimes discern the combined truth value by knowing just one value.&nbsp; In this case, the operators place in the known value that it is certain of.&nbsp; If there is any uncertainty, the operators will resolve with an <span style=\"font-family: Courier;\">NA</span> value to indicate they do not know what value should be placed there.</div><div><br></div>","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":["media/images/1729528470433-TruthTable1.bmp","media/images/1729528475929-TruthTable2.bmp"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"483e729e-8583-4991-984b-5bf654e7ae07":[{"id":"f6e4cf64-c0bd-4dba-bfb7-b1d4bfc0e2a3","displayCommentEventId":"483e729e-8583-4991-984b-5bf654e7ae07","displayCommentEventSequenceNumber":572,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729510205763,"commentText":"Here is the result of adding the columns <span style=\"font-family: Courier;\">what_happens_and </span>and <span style=\"font-family: Courier;\">what_happens_or</span>.&nbsp; Are the results what you would have expected?","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729509831652-oreo4.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image","question"],"questionCommentData":{"allAnswers":["It is never TRUE","It is never FALSE","Both of these","None of the above"],"correctAnswer":"Both of these","question":"What happens when you combine an <span style=\"font-family: Courier;\">NA</span> value with and <span style=\"font-family: Courier;\">NA </span>value via <span style=\"font-family: Courier;\">&amp;</span>?","explanation":"Because <span style=\"font-family: Courier;\">&amp;</span> requires both pieces to be <span style=\"font-family: Courier;\">TRUE</span> and both pieces could be anything, the &amp; result cannot be sure of a logical value.&nbsp; Thus, it is <span style=\"font-family: Courier;\">NA</span>."}}],"aa3e5108-125a-4686-846c-5033996c9f40":[{"id":"09b64bc2-908f-495c-9ca2-f386fed323cc","displayCommentEventId":"aa3e5108-125a-4686-846c-5033996c9f40","displayCommentEventSequenceNumber":625,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729510653967,"commentText":"Sometimes we want to create a new column in our data that does different things based on the logical value in another location.&nbsp; For example, if we wanted a column that was the absolute value of another column, we would want to place the exact value that is there if the number is positive, but the negative of the number if the number is negative.&nbsp;&nbsp;<div><br></div><div>In this situation, we can create new values with the <span style=\"font-family: Courier;\">if_else()</span> function.&nbsp; The syntax of this function is as follows:</div><div><br></div><div>1. The first argument we pass to <span style=\"font-family: Courier;\">if_else()</span> is the logical condition that defines the change in behavior</div><div>2. The second argument we pass to <span style=\"font-family: Courier;\">if_else()</span> is what we want to do if the logical argument evaluates to <span style=\"font-family: Courier;\">TRUE</span></div><div>3. The third argument we pass to<span style=\"font-family: Courier;\"> if_else()</span> is what we want to do if the logical argument evaluates to <span style=\"font-family: Courier;\">FALSE</span></div><div><br></div><div>Be on the look out for these three conditions as the&nbsp; code progresses.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"cbd88b5f-3bb4-4df7-ac7c-03775fd0d361":[{"id":"25f0cbcd-39f7-4cdd-b42e-7f3001676f7d","displayCommentEventId":"cbd88b5f-3bb4-4df7-ac7c-03775fd0d361","displayCommentEventSequenceNumber":658,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729517493835,"commentText":"<span style=\"font-family: Courier;\">current_quantity == 0</span>&nbsp; <span style=\"font-family: Courier;\">| in_season</span> is the first argument: the logical condition we are checking.&nbsp; For each row, whether or not this statement is <span style=\"font-family: Courier;\">TRUE</span> for the row will be generated based on the value in the&nbsp;&nbsp;<span style=\"font-family: Courier;\">current_quantity</span>&nbsp;column (<span style=\"font-family: Courier;\">TRUE</span> or <span style=\"font-family: Courier;\">FALSE</span> depending on whether or not the value there is equal to 0) combined via a logical or with the value in the <span style=\"font-family: Courier;\">in_season</span> column.&nbsp;&nbsp;<div><br></div><div>Intuitively, this means we wish to create a new column in our data frame that determines how much of each item we should order.&nbsp; If the item is out of stock we wish to buy more, but expecting seasonal items to sell fast, we also wish to buy more if the item is in season, and restock our supplies.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"aaec1529-f8d1-4ecb-978c-92fe1e49bfbe":[{"id":"dcaf6b82-115c-47de-9533-d0a47b90d8c3","displayCommentEventId":"aaec1529-f8d1-4ecb-978c-92fe1e49bfbe","displayCommentEventSequenceNumber":747,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729517621579,"commentText":"This second argument is what we want to do if our logical condition evaluates to <span style=\"font-family: Courier;\">TRUE.</span>&nbsp; Here, we determine how much of our product to order based on the difference between the stock we currently have and the value that we consider to be full stock.&nbsp; We compute this by row as <span style=\"font-family: Courier;\">full_stock_quantity - current_quantity</span>, but ONLY IF the logical condition holds for that row.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"8427467d-16d7-4a14-9f08-76fe08b9b37e":[{"id":"c95e1281-b6da-4537-bf66-0402f7ec9c18","displayCommentEventId":"8427467d-16d7-4a14-9f08-76fe08b9b37e","displayCommentEventSequenceNumber":793,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729517666918,"commentText":"The last argument is what we want to do if the logical condition is FALSE.&nbsp; Here, if the logical condition is FALSE, we don't want to buy more, so we place a 0 as the quantity to purchase.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":[],"questionCommentData":null},{"id":"ecf24eae-c0ac-4239-8304-f1c12860843b","displayCommentEventId":"8427467d-16d7-4a14-9f08-76fe08b9b37e","displayCommentEventSequenceNumber":793,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729517760385,"commentText":"","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["full_stock_quantity - current_quantity","0","NA"],"correctAnswer":"NA","question":"We determined what to place in the <span style=\"font-family: Courier;\">how_much</span> column based on whether the logical condition listed first was <span style=\"font-family: Courier;\">TRUE</span> or <span style=\"font-family: Courier;\">FALSE.</span>&nbsp; What do you think happens / is placed in <span style=\"font-family: Courier;\">how_much</span> if the logical expression encounters an <span style=\"font-family: Courier;\">NA</span> value?","explanation":"<span style=\"font-family: Courier;\">NA</span>s tend to generate <span style=\"font-family: Courier;\">NA</span>s."}}],"b3c7f4dd-1667-426d-90b2-f2a76dffb521":[{"id":"bc6de4f1-3f22-4f5a-9ea4-73e28d8ac63a","displayCommentEventId":"b3c7f4dd-1667-426d-90b2-f2a76dffb521","displayCommentEventSequenceNumber":1149,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729518258341,"commentText":"Below is an image of what is generated by <span style=\"font-family: Courier;\">how_much</span> via the<span style=\"font-family: Courier;\"> if_else()</span> on line 15.<div><br></div><div>Note that for something like the first line, oreo, the <span style=\"font-family: Courier;\">current_quantity</span> is not 0 and the item is not considered in season; thus, we place a 0 in <span style=\"font-family: Courier;\">how_much</span>.&nbsp; For something like a Halloween oreo, the item is not out of stock (current quantity is NOT zero), so the amount we order is what we need to return the item to full stock.&nbsp; For an item like white chocolate oreos, which are both out of stock AND in season, we reorder the <span style=\"font-family: Courier;\">full_stock_quantity</span> amount.</div><div><br></div><div>The behavior of this <span style=\"font-family: Courier;\">if_else()</span> is good, but perhaps not perfect.&nbsp; Notice that our tastes like turkey oreos have an <span style=\"font-family: Courier;\">NA</span> value for <span style=\"font-family: Courier;\">in_stock</span>, indicating that (for some reason) the item has been discontinued; but alas, we still have some stock of the item (again, I am perplexed)!&nbsp; It is still true, however, that the item is seasonal, so the way we have written this code indicates we should order more, which, we definitely shouldn't.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729517804042-oreo5.PNG","media/images/1729518251978-TurkeyOreos.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"50894879-1b41-4d51-87fd-82e307a8d516":[{"id":"6871772b-37d2-4422-8c9c-1c9e09ee1124","displayCommentEventId":"50894879-1b41-4d51-87fd-82e307a8d516","displayCommentEventSequenceNumber":1176,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729518448291,"commentText":"Interestingly, we cannot check for <span style=\"font-family: Courier;\">NA</span> values by using something like <span style=\"font-family: Courier;\">in_stock == NA</span>.&nbsp; The proper way to check if a value is an <span style=\"font-family: Courier;\">NA</span> value is through the function <span style=\"font-family: Courier;\">is.na()</span>.&nbsp; The logical check we add here FIRST checks to see if <span style=\"font-family: Courier;\">in_stock</span> is NOT an <span style=\"font-family: Courier;\">NA</span> value- that is the only way we wish to proceed with something that is not a zero in the <span style=\"font-family: Courier;\">how_much </span>column.<div><br></div><div>It is important to place parentheses for grouping around logical expressions that go together, as the computer does not always read logical expressions left to right.&nbsp; If ever you are in doubt, place parentheses around things.&nbsp; The results of this new logical computation are shown below.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1729518446724-oreo6.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null},{"id":"5c08811b-e3cf-4c6d-94b9-ed5964c9d4de","displayCommentEventId":"50894879-1b41-4d51-87fd-82e307a8d516","displayCommentEventSequenceNumber":1176,"developerGroupId":"b1172191-47d0-41f7-964c-7bc8c2bb5e17","timestamp":1729529967503,"commentText":"There was a rebooting error on my computer, so nothing else in the playback is necessary.&nbsp; Enjoy this picture of a baby hippo!","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":["media/images/1729529963057-babyhippo.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/logicals.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}]};
